 --select 'insert into ssn_location(locode, location_name, country, wgs84_lat, wgs84_long) values(''' || locode || ''',''' || replace
 --(location_name, '''', '''''') || ''',''' || replace(country, '''', '''''') || ''',' || case when wgs84_lat is null then 'null' else
 --to_char(wgs84_lat, '000.00000') end || ',' || case when wgs84_long is null then 'null' else to_char(wgs84_long, '000.00000') end || ');'
 --from ais.ssn_location;

